async () => {
		// storeValue('customerOID', '06a108a7');
		const userDetailData = await GetEntityAdministratorData.run();
		userDetailData.forEach(async (user) => {
			await InsertOTUserDetails.run({
				arnNo: user.CUSTOMER_OID,
				userId: user.CUSTOMER_KEY_PERSON_EMAIL.split('@')[0],
				userName: `${user.CUSTOMER_KEY_PERSON_FIRSTNAME} ${user.CUSTOMER_KEY_PERSON_MIDDLENAME ? 		`${user.CUSTOMER_KEY_PERSON_MIDDLENAME} ` : ""}${user.CUSTOMER_KEY_PERSON_LASTNAME}`,
				email: user.CUSTOMER_KEY_PERSON_EMAIL,
				mobile: user.CUSTOMER_KEY_PERSON_MOBILE,
				createdBy: user.CREATE_USER_OID,
				createdDate: user.CREATE_DATE_TIME,
				modifiedBy: user.LAST_UPDATE_USER_OID,
				modifiedDate: user.LAST_UPDATE_DATE_TIME
			})
		})
	}

